import React from "react";
import styled from "styled-components";

const Container = styled.div``;

const Description = styled.div``;

const MainTitle = styled.div``;

const DayColumn = styled.div``;

const DayColumnTitle = styled.div``;

const DayColumnDate = styled.div``;

const RegisterButton = styled.button``;

const HeaderContentBlock = () => (
  <Container>
    <Description>
      오프라인 수강생 5만명 앱스토어 출시 앱 1만건 이상 수강생 만족도 99.9%
    </Description>
    <MainTitle></MainTitle>
    <DayColumn>
      <DayColumnTitle></DayColumnTitle>
      <DayColumnDate></DayColumnDate>
    </DayColumn>
    <DayColumn>
      <DayColumnTitle></DayColumnTitle>
      <DayColumnDate></DayColumnDate>
    </DayColumn>
    <RegisterButton></RegisterButton>
  </Container>
);
export default HeaderContentBlock;
